  const [page, setPage] = useState("Home")
  return (
    <div className="App">
      <p>todo lo que necesitas para tu cocina, conseguilo aca! 

      </p>
      <nav>
        <ul>
          <li>
            <button onClick ={() => setPage("Home")}>Home</button>
          </li>
        </ul>
      </nav>

      <NavbarComponent /> 

      <Home />
      <Catalogos />
      <Contacto />
    </div>
  );
}

export default App;
